function switchTab(selectedTab, modelId, fileId) {
	if (fileId == null)
		fileId = 0;

	var files = document.getElementById('openedFiles');
	for (var i = 0; i < files.childNodes.length; i++) {
		var child = files.childNodes[i];
		child.className = 'file';
	}

	selectedTab.className = 'file active';
	var currentState = editor.saveViewState();
	var currentModel = editor.getModel();
	var lastType = 'client';
	if (data.client.windows.find(x => x.model.id == currentModel.id) != null) {
		let curr = data.client.windows.find(x => x.model.id == currentModel.id);
		curr.state = currentState;
	} else if (data.server.windows.find(x => x.model.id == currentModel.id) != null) {
		let curr = data.server.windows.find(x => x.model.id == currentModel.id);
		curr.state = currentState;
		lastType = 'server';
	}

	if (modelId != lastType) {
		if (lastType == 'client') {
			currClientLibDisposable.dispose();
			currNativesLibDisposable.dispose();
			currServerLibDisposable = monaco.languages.typescript.javascriptDefaults.addExtraLib(serverTypeDefinitions);
		} else {
			currServerLibDisposable.dispose();
			currClientLibDisposable = monaco.languages.typescript.javascriptDefaults.addExtraLib(clientTypeDefinitions);
			currNativesLibDisposable = monaco.languages.typescript.javascriptDefaults.addExtraLib(nativesDefinitions);
		}
	}

	document.getElementsByClassName('currentWindow')[0].innerText = `${modelId == 'client' ? 'Client' : 'Server'} - Window ${fileId}`;

	editor.setModel(data[modelId].windows.find(x => x.id == fileId).model);
	editor.focus();
}

